import React from 'react'

class Info extends React.Component {
  render(){
    return(
      <div className='info'>
        <span class='n-display-breakpoint-first'><h2>Matthew Buckley</h2></span>
        <h3>Self Taught Full Stack Web Developer with a Scientific Background</h3>
        <p>
          Learning the MERN stack; Mongo, Express, React and Node, along with associated technologies.
        </p>
        <p>
          I am looking for opportunities to learn and solve problems.
        </p>
      </div>
    )
  }
}

export default Info
